    /*
    1157. 子数组中占绝大多数的元素
    实现一个 MajorityChecker 的类，它应该具有下述几个 API：

    MajorityChecker(int[] arr) 会用给定的数组 arr 来构造一个 MajorityChecker 的实例。
    int query(int left, int right, int threshold) 有这么几个参数：
    0 <= left <= right < arr.length 表示数组 arr 的子数组的长度。
    2 * threshold > right - left + 1，也就是说阈值 threshold 始终比子序列长度的一半还要大。
    每次查询 query(...) 会返回在 arr[left], arr[left+1], ..., arr[right] 中至少出现阈值次数 threshold 的元素，如果不存在这样的元素，就返回 -1。

    示例：
    MajorityChecker majorityChecker = new MajorityChecker([1,1,2,2,1,1]);
    majorityChecker.query(0,5,4); // 返回 1
    majorityChecker.query(0,3,3); // 返回 -1
    majorityChecker.query(2,3,2); // 返回 2

    提示：
    1 <= arr.length <= 20000
    1 <= arr[i] <= 20000
    对于每次查询，0 <= left <= right < len(arr)
    对于每次查询，2 * threshold > right - left + 1
    查询次数最多为 10000
     */

    /**
     * 提交超时
     * 本地测试用例 168ms
     * arr中，从左往右统计出每一个数字出现的索引数组，
     * 对于一个数字的索引数组 indexes，通过二分查找找到大于等于left的indexL，
     * 如果 indexL + threshold - 1 < indexes.length && indexes[indexL + threshold - 1] <= right，则这个数字满足要求
     */
    class MajorityChecker_1 {

        private Map<Integer, List<Integer>> valueIndexes = new HashMap<>();

        public MajorityChecker_1(int[] arr) {
            for (int i = 0; i < arr.length; i++) {
                int value = arr[i];
                List<Integer> indexes = valueIndexes.computeIfAbsent(value, key -> new ArrayList<>());
                indexes.add(i);
            }
        }

        public int query(int left, int right, int threshold) {
            for (Map.Entry<Integer, List<Integer>> entry : valueIndexes.entrySet()) {
                List<Integer> indexes = entry.getValue();
                int size = indexes.size();
                if (size < threshold) {
                    continue;
                }

                int indexL = indexes.get(0);
                int indexR = indexes.get(size - 1);
                if (indexR < left || indexL > right) {
                    // 没有交集
                }
                else {
                    // 二分查找左边界的index
                    int leftI = findLeftEdge(indexes, left, 0, size - 1);
                    int rightI = leftI + threshold - 1;
                    if (rightI < size && indexes.get(rightI) <= right) {
                        return entry.getKey();
                    }
                }
            }
            return -1;
        }

        private int findLeftEdge(List<Integer> indexes, int target, int left, int right) {
            if (left >= right) {
                return indexes.get(right) >= target ? right : indexes.size();
            }

            int mid = (left + right) / 2;
            int midV = indexes.get(mid);
            if (midV == target) {
                return mid;
            }
            else if (indexes.get(left) >= target) {
                return left;
            }
            else if (midV > target) {
                return findLeftEdge(indexes, target, left + 1, mid);
            }
            else {
                return findLeftEdge(indexes, target, mid + 1, right);
            }
        }

    }

    /**
     * 提交超时
     * 本地测试用例 37ms
     */
    class MajorityChecker_2 {

        private final int[] arr;

        public MajorityChecker_2(int[] arr) {
            this.arr = arr;
        }

        public int query(int left, int right, int threshold) {
            if (left == right) {
                return threshold == 1 ? arr[left] : -1;
            }

            int maybeMaj = arr[left];
            int count = 0;
            for (int i = left; i <= right; i++) {
                int num = arr[i];
                if (count == 0 || num == maybeMaj) {
                    maybeMaj = num;
                    count++;
                }
                else {
                    count--;
                }
            }
            if (count >= threshold - (right - left + 1 - threshold)) {
                count = 0;
                for (int i = left; i <= right; i++) {
                    if (maybeMaj == arr[i]) {
                        count++;
                    }
                }
                return count >= threshold ? maybeMaj : -1;
            }
            return -1;
        }
    }

    /**
     * AC 303ms
     * 测试用例耗时 10ms
     * 求区间内第K小的数
     * 划分树
     * https://njzwj.github.io/2017/06/29/partition-tree-notes-1/
     * https://debug.fanzheng.org/post/merger-tree-and-parti-tree.html
     *
     * 划分树图解
     * http://note.youdao.com/noteshare?id=487b4c930bdb30c59982098ae5f1c182&sub=43A8B3666AD14F538FDDDBA7310A6338
     */
    class MajorityChecker {

        private final class DividingTree {

            private final int[] orignal;

            private final int[] sorted;

            private final int[][] levels;

            private final int[][] toLeftCountsForLevels;

            public DividingTree(int[] arr) {
                this.orignal = arr;
                sorted = Arrays.copyOf(arr, arr.length);
                Arrays.sort(sorted);
                levels = new int[(int) Math.ceil(Math.log(arr.length) / Math.log(2))][arr.length];
                toLeftCountsForLevels = new int[levels.length][arr.length];
                build(0, arr.length - 1, 0);
            }

            private void build(int left, int right, int levelIndex) {
                if (left == right) {
                    return;
                }

                int[] preLevel = levelIndex == 0 ? orignal : levels[levelIndex - 1];
                int[] level = levels[levelIndex];
                int[] toLeftCounts = toLeftCountsForLevels[levelIndex];

                int mid = (left + right + 1) >> 1; // 奇数个，取正中间；偶数个，取中间靠右边的
                int midV = sorted[mid];

                // 在排序后的数组中统计左半边有多少个等于midV，就知道应该放多少个midV到右边
                int sameToMidAtLeftHalf = 0;
                for (int i = left; i < mid; i++) {
                    if (sorted[i] == midV) {
                        sameToMidAtLeftHalf++;
                    }
                }

                int toRightI = mid;
                int toLeftCount = 0;
                for (int i = left; i <= right; i++) {
                    int value = preLevel[i];
                    if (value == midV && sameToMidAtLeftHalf == 0) {
                        level[toRightI++] = value;
                        toLeftCounts[i] = toLeftCount;
                    }
                    else if (value > midV) {
                        level[toRightI++] = value;
                        toLeftCounts[i] = toLeftCount;
                    }
                    else {
                        if (value == midV) {
                            sameToMidAtLeftHalf--;
                        }
                        level[left + toLeftCount] = value;
                        toLeftCounts[i] = ++toLeftCount;
                    }
                }
                build(left, mid - 1, levelIndex + 1);
                build(mid, right, levelIndex + 1);
            }

            /**
             * 在 left ~ right 区间查找第 k 小的值，k从1开始计算
             */
            private int query(int left, int right, int k) {
                if (left == right) {
                    return orignal[left];
                }

                int nodeL = 0;
                int nodeR = orignal.length - 1;
                int levelIndex = -1;
                do {
                    levelIndex++;
                    int[] toLeftCounts = toLeftCountsForLevels[levelIndex];
                    // (nodeL ~ right 这个区间移动到左子节点的个数) - (nodeL ~ left - 1 这个区间移动到左子节点的个数) = (left ~ right 这个区间移动到左子节点的个数)
                    int moveToLeftOnLeftSide = left > nodeL ? toLeftCounts[left - 1] : 0;
                    int moveToLeft = toLeftCounts[right] - moveToLeftOnLeftSide;
                    if (moveToLeft >= k) {
                        // 继续在左边查找
                        left = nodeL + moveToLeftOnLeftSide;
                        right = nodeL + toLeftCounts[right] - 1;
                        nodeR = (nodeL + nodeR - 1) / 2;
                    }
                    else {
                        // 继续在右边查找
                        int mid = (nodeL + nodeR + 1) / 2;
                        k -= moveToLeft;
                        left = mid + left - 1 - nodeL + 1 - moveToLeftOnLeftSide;
                        right = mid + right - nodeL + 1 - toLeftCounts[right] - 1;
                        nodeL = mid;
                    }
                } while (left != right);
                return levels[levelIndex][left];
            }

        }

        private final DividingTree dividingTree;

        private Map<Integer, List<Integer>> valueIndexes = new HashMap<>();

        public MajorityChecker(int[] arr) {
            dividingTree = new DividingTree(arr);
            for (int i = 0; i < arr.length; i++) {
                int value = arr[i];
                List<Integer> indexes = valueIndexes.computeIfAbsent(value, key -> new ArrayList<>());
                indexes.add(i);
            }
        }

        public int query(int left, int right, int threshold) {
            int mid = (left + right + 1) / 2;
            int k = mid - left + 1;
//            long now = System.nanoTime();
            int maybeMajority = dividingTree.query(left, right, k);
//            System.out.println((System.nanoTime() - now) + "us");
            List<Integer> indexes = valueIndexes.get(maybeMajority);
            int size = indexes.size();
            if (size >= threshold) {
                // 二分查找值=maybeMajority的最左边的index
                int leftI = findLeftEdge(indexes, left, 0, size - 1);
                if (indexes.get(leftI) <= right) {
                    int rightI = leftI + threshold - 1;
                    if (rightI < size && indexes.get(rightI) <= right) {
//                        System.out.println((System.nanoTime() - now) + "us\n");
                        return maybeMajority;
                    }
                }
            }
//            System.out.println((System.nanoTime() - now) + "us\n");
            return -1;
        }

        private int findLeftEdge(List<Integer> indexes, int target, int left, int right) {
            if (left >= right) {
                return indexes.get(right) >= target ? right : indexes.size();
            }

            int mid = (left + right) / 2;
            int midV = indexes.get(mid);
            if (midV == target) {
                return mid;
            }
            else if (indexes.get(left) >= target) {
                return left;
            }
            else if (midV > target) {
                return findLeftEdge(indexes, target, left + 1, mid);
            }
            else {
                return findLeftEdge(indexes, target, mid + 1, right);
            }
        }

    }

